  [],\n\t\"revision_timestamp\": \"2015-09-27T01:48:03.989302\",\n\t\"name\": \"salinity-water-temperature-fluorescence-photosynthetic-active-radiation-par-and-other-profile-d\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115255 includes profile,
  biological and physical data collected aboard the ALPHA HELIX during cruises HX242,
  HX244, HX247, HX271 and HX275 in the Gulf of Alaska from 2001-04-18 to 2003-08-11.
  These data include SALINITY, WATER TEMPERATURE, FLUORESCENCE, PHOTOSYNTHETIC ACTIVE
  RADIATION (PAR), TRANSMISSIVITY and SIGMA-T. The instruments used to collect these
  data include CTD. These data were collected by Suzanne Strom of Western Washington
  University as part of NEP. The Biological and Chemical Oceanography Data Management
  Office (BCO-DMO) submitted these data to NODC on 2013-09-28.nnThe following is the
  text of the abstract provided by BCO-DMO:nnCTD Data from Process cruises in 2001
  and 2003nThese CTD data are from five process cruises conducted in 2001 and 2003
  in the CGOA.nNOTE 1: On the two cruises (HX271 and HX275) from 2003, \"press\" is
  provided (in dBAR). However, for cruises HX242, HX244, and HX247 (all in 2001),
  \"depth\" in meters is used rather than \"press\" in dBar. Since for all practical
  purposes, depth in meters and pressure in dBar are identical, for all five cruises,
  this parameter is called pressure in displaying the data.nData Contact:nSuzanne
  L. StromnWestern Washington UniversitynShannon Point Marine Centern1900 Shannon
  Point RoadnAnacortes, WA 98221-4042nstroms@cc.wwu.edu (mailto:stroms@cc.wwu.edu)nPhone:
